import './PBatStats.css'
import '/Users/sathwikanil/Desktop/sathwik/sath/cricer/frontend/src/components/css/teams.css'
import React, { useState, useEffect } from 'react';
import Photocard from "../../Photocard/Photocard";
function PBatStats(props) {

    let url = `http://localhost:3001/player/${props.p_id}/bat_stats`
    console.log(url)
    const [all, setall] = useState(null);
    const [data, setdata] = useState(all);

    useEffect(() => {
        const fetchData = async () => {
        const response = await fetch(url);
        const jsonData = await response.json();
            setall(jsonData);
        };
        fetchData();
    }, []);

    const handleCareer = () => {
        setdata(all.career)
    };

    if (!all) {
        return <div>Loading...</div>;
      }

    setdata(all.int)
    if (!data) {
        return <div>Loading...</div>;
    }

    return (
        <div className={`player_stats ${data.tour}`}>
            <div className={`pstat_box ${data.color}1`}>
                <div className='pstat_header'>
                    <Photocard height={'100px'} p_id={props.p_id}/>
                    <div className='pstat_header_info'>
                        <div className='pstat_header_playername'>
                            {data.playername}
                        </div>
                        <div className='pstat_header_teamname'>
                            {data.teamname}
                        </div>
                    </div>
                </div>
                <div className='p_statbox'>
                    <div className='p_statbox_left '>
                        <div className='p_statbox_keys'>
                            <div className='p_statbox_keys_item'>Matches</div>
                            <div className='p_statbox_keys_item'>Innings</div>
                            <div className='p_statbox_keys_item'>Runs</div>
                            <div className='p_statbox_keys_item'>Average</div>
                            <div className='p_statbox_keys_item'>Strike-rate</div>
                            <div className='p_statbox_keys_item'>Dot %</div>
                            <div className='p_statbox_keys_item'>Boundary %</div>
                        </div>
                        <div className={`p_statbox_values ${data.color}2`}>
                            <div className='p_statbox_values'>
                                <div className='p_statbox_values_item'>{data.matches}</div>
                                <div className='p_statbox_values_item'>{data.innings}</div>
                                <div className='p_statbox_values_item p_stat_bold'>{data.runs}</div>
                                <div className='p_statbox_values_item'>{data.average}</div>
                                <div className='p_statbox_values_item p_stat_bold'>{data.sr}</div>
                                <div className='p_statbox_values_item'>{data.dot_p}</div>
                                <div className='p_statbox_values_item'>{data.boundary_p}</div>
                            </div>
                        </div>
                    </div>
                    <div className='pstat_emptybox'></div>
                    <div className='p_statbox_right'>
                        <div className='p_statbox_keys'>
                            <div className='p_statbox_keys_item'>Fours</div>
                            <div className='p_statbox_keys_item'>Sixes</div>
                            <div className='p_statbox_keys_item'>Thirties</div>
                            <div className='p_statbox_keys_item'>Fifties</div>
                            <div className='p_statbox_keys_item'>Hundreds</div>
                            <div className='p_statbox_keys_item'>Not outs</div>
                        </div>
                        <div className={`p_statbox_values ${data.color}2`}>
                            <div className='p_statbox_values'>
                                <div className='p_statbox_values_item'>{data.fours}</div>
                                <div className='p_statbox_values_item'>{data.sixes}</div>
                                <div className='p_statbox_values_item'>{data.thirties}</div>
                                <div className='p_statbox_values_item p_stat_bold'>{data.fifties}</div>
                                <div className='p_statbox_values_item'>{data.hundreds}</div>
                                <div className='p_statbox_values_item'>{data.not_outs}</div>
                            </div>
                        </div>
                    </div>
                </div>

            </div>
            <div className={`p_stat_buttons`}>
                <div onClick={handleCareer()} className='p_stat_button_item'>Career</div>
                {/*<div onClick={handleInt} className='p_stat_button_item'>INT</div>*/}
                {/*<div onClick={handleIpl} className='p_stat_button_item'>IPL</div>*/}
                {/*<div onClick={handleCsl} className='p_stat_button_item'>CSL</div>*/}
                {/*<div className='p_stat_button_item'>WT20-1</div>*/}
                {/*<div className='p_stat_button_item'>WT20-2</div>*/}
                {/*<div className='p_stat_button_item'>WT20-3</div>*/}
                {/*<div className='p_stat_button_item'>IPL-1</div>*/}
                {/*<div className='p_stat_button_item'>CSL-1</div>*/}
                {/*<div className='p_stat_button_item'>CSL-2</div>*/}


            </div>

        </div>
    );

}

export default PBatStats
